import React from 'react'
import NavabaMenu from '../Menu/NavabaMenu';
import Footer from '../Footer/Footer';
import MenuTendance from '../Menu/MenuTendance'


const Tendance = () => {
    return (
        <div>
            <NavabaMenu/>

                <div class="hero_home_tendance version_3">
                    <div class="content"> 
                    </div>
                </div>

                <MenuTendance/> 

            <Footer/>   
        </div>
    )
}

export default Tendance;
